import React from 'react';
import "../styles/about.css";

export default class About extends React.Component {
    render() {
        return(
            <React.Fragment>
                <div className="about-container">
                <h1>Canada's Largest</h1>
                </div>
            </React.Fragment>
        )
    }

}
